import React from 'react';
import { Handle, Position } from 'reactflow';

const MultiPurposeNode = ({}) => {
  return (
    <div className="custom-node" style={{ border: '1px solid #ddd', padding: '10px', backgroundColor: '#f9f9f9' }}>
      {/* Node content, e.g., a label */}
      

      {/* Source handle */}
      <Handle type="source" position={Position.Bottom} id="a" style={{ background: '#555' }} />

      {/* Target handles */}
      <Handle type="target" position={Position.Top} id="b" style={{ top: '10%', background: '#555' }} />
      <Handle type="target" position={Position.Top} id="c" style={{ top: '90%', background: '#555' }} />
    </div>
  );
};

export default MultiPurposeNode;
